##说明:
##APPID: 应用ID(如果是应用,要有APPID,否则填-1)
##TITLE: 标题
##URL: url
##TYPE: 类型（应用：0；非应用（无APPID）：-1）
##PROPERTY: 属性（能否移动、删除等，使用位表示，如：3（1|2）表示不可移动和删除）
##ICON_NAME: 内置图标,可以是在assets目录中的文件,也可以是一个drawable图标,请确保图标的存在
##ICON_URL: 后台图标URL.如果有图标的URL后台地址,请保证与内置的图标版本一致,发布前需要确认，不然图标更新逻辑会有问题
##FLAG_UNACCESS: 是否标记新标志（1标记，0不标记）
##FLAG_NO_DEFAULT：是否标记为非默认内置快链，非默认内置快链在拉到后台的配置时不会清除（1标记，0不标记）
##FLAG_FOR_DESKTOP：是否是一个桌面文件夹链接（1是，0不是）
